import React from 'react'

const Works = () => {
  return (
    <div className='max-w-[1640px] m-auto px-4 py-12 bg-pink-300'>
        <div className='container'>
            <div>
                <h1>Global Freelance expertly connects professionals with businesses seeking specialised talent</h1>
            </div>
        </div>
    </div>
  )
}

export default Works
